OK so about a year ago (June5th 2022) Ray came in our new office and told us he wanted to start a podcast …..and we had about 20 minutes to get it together lol 🤯😱

I wanted to plan it out 
make a whole scheduling 
figure out a name
 the dates and times we were going to drop. 
I really wanted to structure it but Ray being a the Virgo assertive men that he is told us “JUST GO, we have everything we need already.” and we’ve been up ever since and I’m thankful for everyone who’s been on his journey with us 🫶🏾

We started this podcast kind of as a “social experiment”. Ray wanted to prove to the artist that he was working with that If you consistently put out content and quality content , the people will eventually follow and he was right‼️🤭

I say all of that to say, don’t wait for the perfect moment there’s never gonna be one JUST GO‼️

